import React from "react";

const Builder1 = ({ ...props }) => {
  return (
    <div className="grid grid-cols-12">
      <div className="col-span-2 h-screen text-white bg-gray-700">
        {props.debug ? (
          props.contact
        ) : (
          <div className="p-3 flex-col">
            <span>Contact</span>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
          </div>
        )}
        {props.debug ? (
          props.languages
        ) : (
          <div className="p-3 flex-col">
            <span>Langauges</span>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
          </div>
        )}
      </div>
      <div className="col-span-10 h-screen text-black">
        {props.debug ? (
          props.personal_profile
        ) : (
          <div className="p-3 flex-col">
            <span>Personal Profile</span>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
          </div>
        )}

        {props.debug ? (
          props.education
        ) : (
          <div className="p-3 flex-col">
            <span>Education</span>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
          </div>
        )}

        {props.debug ? (
          props.projects
        ) : (
          <div className="p-3 flex-col">
            <span>Projects</span>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
          </div>
        )}

        {props.debug ? (
          props.experience
        ) : (
          <div className="p-3 flex-col">
            <span>Experience</span>

            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
            <div className="w-full p-3 bg-gray-400 mb-2"></div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Builder1;
